(169, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:59:\"How To Build a Mega Menu With Elementor and the Plus Addons\";s:7:\"excerpt\";s:251:\"Do your site visitors need to hover over an awkward drop-down, in the hopes of picking the right option? Then you need a mega-menu. In this tutorial, we\'ll show you how to create your own custom WordPress mega menu using Elementor and The Plus Addons.\";s:7:\"created\";i:1603963969;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:119:\"https://elementor.com/blog/wordpress-mega-menu/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:67:\"How To Choose The Right Brand Imagery For Your Business | Elementor\";s:7:\"excerpt\";s:148:\"Brand imagery plays a vital role in creating a positive and long-lasting association with your brand. Discover how to choose the right one for you. \";s:7:\"created\";i:1603895496;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:113:\"https://elementor.com/blog/brand-imagery/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:30:\"Meet Our Leaders: Menny Benady\";s:7:\"excerpt\";s:265:\"A web professional and digital marketing expert, Menny Benady is an artist who dabbles with different methods and techniques — from sketching to oil and acrylic painting and sculpting. This month, we introduce you to the leader of the Israel Elementor Community! \";s:7:\"created\";i:1603787082;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:129:\"https://elementor.com/blog/meet-our-leaders-menny-benady/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:50:\"Elementor Sites of  September 2020: Magazine Sites\";s:7:\"excerpt\";s:325:\"Get ready to see some of the best magazine and blog websites built with Elementor. This month’s showcase explores the top ten magazine or blog websites from our user community, and shows prime examples for how to design your next blog or magazine site, with 